import sys


def check_regions_dictionary(expected, actual):
    if actual is None or len(expected) != len(actual):
        print('Incorrect result. Dictionary has incorrect length.')
        print('    Expected length: ' + str(len(expected)))
        print(f'    Actual length: {(0 if actual is None else str(len(actual)))}')
        return False

    all_ok = True
    for key in expected:
        if key in actual:
            if not isinstance(actual[key], type(expected[key])):
                print('Incorrect type found in dictionary for value associated with key {}.'.format(key))
                print('    Expected type: ' + str(type(expected[key])))
                print('    Actual type: ' + str(type(actual[key])))
            if sorted(actual[key]) != sorted(expected[key]):
                print('Incorrect value found in dictionary for key {}.'.format(key))
                print('    Expected value: ' + str(key) + ' -> ' + str(expected[key]))
                print('    Actual value: ' + str(key) + ' -> ' + str(actual[key]))
                all_ok = False
        else:
            print('Key missing from dictionary: {}'.format(key))
            all_ok = False
    if all_ok:
        print('Dictionary correct.')
        return True
    else:
        print('Dictionary incorrect.')
        return False


